export interface StructuredOutputFilterDto {
    /** Equal to */
    eq?: string;
    /** Not equal to */
    neq?: string;
    /** Greater than */
    gt?: string;
    /** Greater than or equal to */
    gte?: string;
    /** Less than */
    lt?: string;
    /** Less than or equal to */
    lte?: string;
    /** Contains */
    contains?: string;
    /** Not contains */
    notContains?: string;
}
